import React from "react";
import Tables from "./components/Tables";
import { Router, Route, Switch } from "react-router-dom";
import "./App.css";

function App() {
  <Switch>
    <Route exact path="/:tableid" component={Tables} />
  </Switch>;
}

export default App;
